import React, { Component } from 'react';
import { withStyles } from '@material-ui/core/styles';
import SideNav, { NavItem, NavText } from '@trendmicro/react-sidenav';
import '@trendmicro/react-sidenav/dist/react-sidenav.css';


const styles = {
    root: {
        flexGrow: 1,
        position: "sticky",
        marginLeft: "0px",
        // boxShadow: "5px 10px 18px #888888"
    },
    grow: {
        flexGrow: 1,
    },
    menuButton: {
        // marginLeft: -12,
        // marginRight: 20,
    },
};

class SideNavbar extends Component {

    constructor(props) {
        super(props);

        this.state = {
            open: true
        };

        this.toggle = this.toggle.bind(this);
    }

    toggle() {
        this.setState(prevState => ({
            open: !prevState.open
        }));
    }

    render() {
        const { classes } = this.props;
        const { open } = this.state.open;
        let home, example, render1, render2;
        if (open) {
            home = <NavText>Home</NavText>;
            example = <NavText>Basic Example</NavText>;
            render1 = <NavText>Render Ex. 1</NavText>;
            render2 = <NavText>Render Ex. 2</NavText>;
        }
        return (
        <div className={classes.root}>
            <SideNav>
                <SideNav.Toggle />
                <SideNav.Nav>
                    <NavItem id="home">
                        {home}
                    </NavItem>
                    <NavItem id="basic">
                        {example}
                    </NavItem>
                    <NavItem id="renderitems">
                        {render1}
                    </NavItem>
                    <NavItem id="renderitems2">
                        {render2}
                    </NavItem>
                </SideNav.Nav>
            </SideNav>
        </div>
        )
    }
}


export default (withStyles(styles)(SideNavbar));
